from sage.graphs.generators.basic import CycleGraph
from sage.graphs.graph import Graph
# Define some simple examples

C5 = CycleGraph(5)

# The following graph is Figure 6 in Florez et al. Minimal Prime Graphs of Finite Solvable Groups
# It is given as an example of a non-reseminant minimal prime graph
# However, NR8 is not a prime graph itself, so while it passes the edge removal test, it is not a minimal prime graph
# Since the complement already has a triangle adding any edge to the complement will automatically fail that edge
# So ultimately doesn't mean a lot
# One triangle in the complement is between vertices 0, 5, 6. There might be others
NR8 = Graph(
    {0: [1, 7],
     1: [0, 2],
     2: [1, 3],
     3: [1, 2, 4, 5, 6],
     4: [3, 5, 6, 7],
     5: [1, 3, 4, 7],
     6: [3, 4, 7],
     7: [0, 4, 5, 6]})

NR8.set_pos(
    {0: (0, 2),
     1: (1, 2),
     2: (2, 2),
     3: (1.7, 1.5),
     4: (1, .8),
     5: (1.35, 1),
     6: (2, 0),
     7: (0, 1)})


